import React from 'react'

const Navigation = () => {
  return (
    <>
    <Logo></Logo>
    <Sidenav></Sidenav>
    <Search></Search>
    </>
  )
}

let Search =()=>{

  return(
    <>
    <input type="text"/>
    <input type="text" placeholder="Search products"/>
    </>
  )
}


let Logo =()=>{

  return(
    <div className="logo">
     <img src="" alt="" className="logo-image"/>
    </div>
  )
}
let Sidenav =()=>{

  return(
    <div className="navbar">
      <div className="nav"><img src="" alt="" className="nav-image"/></div>
      <div className="nav"><img src="" alt="" className="nav-image"/></div>
      <div className="nav"><img src="" alt="" className="nav-image"/></div>
    </div>
  )
}

export default Navigation
